		document.addEventListener("DOMContentLoaded",catch_broken_images,false);
		
		function catch_broken_images(images){
			
			images = images || document.images;
			
			for(var i=0; i<images.length; i++){
				images[i].onerror = function(){
					this.dataset.src_initial = this.src;
					this.setAttribute("src","");
				};
			}
		}
		
